import React from 'react'
import MenuList from './MenuList';

const SelectedItem = ({ match }) => {

    const [menuId] = match.params.menuId;
    return (
        <React.Fragment>
            {MenuList.list[menuId]}
        </React.Fragment>
    )
}

export default SelectedItem;
